import logo from './logo.svg';
import './App.css';
import Header from './Components/Header';
import Menu from './Components/Menu';
import Profile from './Components/Profile';

const App = () => {
	return (
		<div className='app-wrapper'>
			<Header />
			<div className='content-wrapper'>
				<Menu />
				<Profile />
			</div>
		</div >
	)
}



export default App;
